    /**
     * This method implements the singleton patter to return the existing
     * instance of StaticAndSoftwarePackage or, if it does is instantiated yet,
     * it creates the first instance.
     *
     * @return an instance of StaticAndSofwarePackage (new, or the existing
     * one).
     */
    public static StaticAndSofwarePackageOrSaaS getInstance() {
        StaticAndSofwarePackageOrSaaS localInstance = StaticAndSofwarePackageOrSaaS.instance;
        if (localInstance == null) {
            synchronized (StaticAndSofwarePackageOrSaaS.class) {
                localInstance = StaticAndSofwarePackageOrSaaS.instance;
                if (localInstance == null) {
                    StaticAndSofwarePackageOrSaaS.instance = localInstance = new StaticAndSofwarePackageOrSaaS();
                }
            }
        }
        return localInstance;
    }

